import React from 'react';
import logo from './logo.svg';
import logo1 from './logo_oficial.png'; // relative path to image 
import './App.css';
import navegador from './componentes/navegador.js';


function App() {
  return (
    <div className="App">
      <a href="#">
        <img src={logo1} className="logo" alt="logo" width="45px" height="45px" />
        lue Shopping
      </a>



    </div>
  );
}

export default App;
